import React from 'react';
import '../styles/logo.css'; // стили для анимации

function Logo() {
  return (
        <svg
      className="brush-icon"
      width="50"
      height="50"
      viewBox="0 0 64 64"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      role="img"
      aria-label="Brush Icon"
    >
      {/* Ручка кисточки */}
      <rect x="26" y="36" width="12" height="20" fill="#8B4513" rx="2" />
      {/* Щетина кисточки */}
      <path
        d="M18 20 L46 20 L38 36 L26 36 Z"
        fill="#FF6347"
        stroke="#CC4E3E"
        strokeWidth="2"
      />
    </svg>
  );
}

export default Logo;
